import React from "react";

const headerStyle = {
  color: '#f3be85',
  padding: '20px',
  display: 'flex',
  justifyContent: 'space-between'
}

const Header = () => {
  return (
    <header className="header" style={headerStyle}>
         <h1>ViajaEnVan</h1>
         <ul>
           <li>Inicio</li>
           <li>Destinos</li>
           <li>Servicios</li>
           <li>Cotactenos</li>
        </ul>
      </header>
  );
};

export default Header;
